import React from "react";

export default function Bill({info}) {
    
    return (
        <div>
          <h3>{info.date}</h3>
          <h3>Amount: {info.amount}</h3>
          <p>{info.hospital}</p>
          <p>{info.patient}</p>
          <p>{info.address}</p>
          {/* Render additional bill information here */}
        </div>
      );
}
